import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ProductTable() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get('http://localhost:5002/getProductsWithImage');
      setProducts(response.data);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  const handleDelete = async (productId) => {
    try {
      await axios.delete(`http://localhost:5002/delete/${productId}`);
      fetchData(); // Fetch data again after successful deletion
    } catch (error) {
      console.error('Error deleting data:', error);
    }
  };

  return (
    <div>
      <section className="items-center lg:flex bg-white lg:h-screen font-poppins dark:bg-gray-800">
        <div className="justify-center flex-1 max-w-6xl px-4 py-4 mx-auto lg:py-8 md:px-6">
          <div className="pt-4 rounded shadow bg-stone-100 dark:bg-gray-900">
            <div className="flex flex-wrap items-center justify-between px-6 pb-4 border-b dark:border-gray-700">
              <h2 className="mb-4 text-xl font-bold md:mb-0 dark:text-gray-400">
                List of documents
              </h2>
              {/* ... search input ... */}
            </div>
            <div className="p-4 overflow-x-auto">
              <table className="w-full table-auto">
                <thead>
                  <tr className="text-sm text-left text-gray-500 dark:text-gray-400">
                    <th className="px-6 pb-3 font-medium">Product Name </th>
                    <th className="px-6 pb-3 font-medium">Price </th>
                    <th className="px-6 pb-3 font-medium">Category </th>
                    <th className="px-6 pb-3 font-medium">Actions </th>
                  </tr>
                </thead>
                <tbody>
                  {products.map((product, index) => (
                    <tr key={index} className="text-sm dark:text-gray-400 dark:bg-transparent">
                      <td className="flex items-center px-6 py-5 font-medium">
                        <input className="mr-4" type="checkbox" name="" id="" />
                        <p className="">{product.name}</p>
                      </td>
                      <td className="px-6 py-5 font-medium ">{product.price}</td>
                      <td className="px-6 py-5 font-medium ">{product.category}</td>
                      <td className="flex items-center px-6 py-5 ">
                        <a
                          href="#"
                          className="font-medium text-red-600 hover:text-red-500 dark:hover:text-red-300 dark:text-red-400"
                          onClick={() => handleDelete(product.productId)}
                        >
                          <svg
                            xmlns="http://www.w3.org/2000/svg"
                            width={16}
                            height={16}
                            fill="currentColor"
                            className="w-4 h-4 bi bi-trash-fill"
                            viewBox="0 0 16 16"
                          >
                            <path d="M2.5 1a1 1 0 0 0-1 1v1a1 1 0 0 0 1 1H3v9a2 2 0 0 0 2 2h6a2 2 0 0 0 2-2V4h.5a1 1 0 0 0 1-1V2a1 1 0 0 0-1-1H10a1 1 0 0 0-1-1H7a1 1 0 0 0-1 1H2.5zm3 4a.5.5 0 0 1 .5.5v7a.5.5 0 0 1-1 0v-7a.5.5 0 0 1 .5-.5zM8 5a.5.5 0 0 1 .5.5v7a.5.5 0 0 1-1 0v-7A.5.5 0 0 1 8 5zm3 .5v7a.5.5 0 0 1-1 0v-7a.5.5 0 0 1 1 0z" />
                          </svg>
                        </a>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
              {/* ... pagination ... */}
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default ProductTable;





